import React from "react";

import { DisplayPair } from "../DisplayPair";

export const FolderWindow = ({ folder }) => {
  return (
    <div>
      <span>{folder.folderName}</span>
      <div>
        {folder.words.map((wordPair, key) => (
          <DisplayPair key={key} wordPair={wordPair} />
        ))}
      </div>
      <br />
    </div>
  );
};
